create table drivers
(
    "driverId"  integer not null
        constraint drivers_pk
            primary key,
    "driverRef" text,
    number      integer,
    code        text,
    forename    text,
    surname     text,
    dob         text,
    nationality text,
    url         text
);

alter table drivers
    owner to postgres;

create unique index drivers_driverid_uindex
    on drivers ("driverId");

